import React from 'react';
import '../styles/textarea.css';

const e = React.createElement;

class Console extends React.Component{


    renderLines(){
         return this.props.console.join("\n");
    }

    render(){
        return e(
            'textarea',
            {
                className:'console',
            },
            this.renderLines()
        )
    }


}

export default Console;
